import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css'

class Board extends React.Component {
  renderSquare(i) {
    return <Square value={i} />;
  }
}

class Square extends React.Component {
  render() {
    return (
      <button classname="square">
        {this.props.value}
      </button>
    );
  }
}
